      i0.ɵɵtext(115, " \u043D\u0435\u00A0\u0437\u043D\u0430\u043B\u0430, \u0447\u0442\u043E \u0441\u0432\u043E\u0435 \u0441\u0430\u043C\u043E\u0435 \u0441\u0438\u043B\u044C\u043D\u043E\u0435 \u0432\u00A0\u0436\u0438\u0437\u043D\u0438 \u0443\u0432\u0435\u043B\u0435\u0447\u0435\u043D\u0438\u0435 \u043E\u043D\u0430 \u043D\u0430\u0439\u0434\u0435\u0442 \u043F\u043E\u0437\u0436\u0435 \u0438\u00A0\u0432\u00A0\u0441\u043E\u0432\u0441\u0435\u043C \u0434\u0440\u0443\u0433\u043E\u0439 \u043E\u0431\u043B\u0430\u0441\u0442\u0438. \u041E\u043A\u043E\u043D\u0447\u0438\u043B\u0430 \u043F\u043E\u043B\u0438\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0442, \u043F\u043E\u0439\u0442\u0438 \u0432\u00A0\u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043F\u043E\u0441\u043E\u0432\u0435\u0442\u043E\u0432\u0430\u043B\u0430 \u043C\u0430\u043C\u0430, \u043F\u0440\u043E\u0440\u0430\u0431\u043E\u0442\u0430\u043B\u0430 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u043B\u0435\u0442 \u043F\u043E\u00A0\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u0438 \u0432\u00A0\u041E\u0431\u043D\u0438\u043D\u0441\u043A\u0435. \u0420\u0430\u0431\u043E\u0442\u0430\u043B\u0430 \u0445\u043E\u0440\u043E\u0448\u043E, \u043D\u043E\u00A0\u0431\u0435\u0437 \u0438\u043D\u0442\u0435\u0440\u0435\u0441\u0430. \u041F\u043E\u0442\u043E\u043C \u0447\u0435\u0440\u0435\u0437 \u043A\u043B\u0443\u0431 \u043C\u043E\u043B\u043E\u0434\u044B\u0445 \u0443\u0447\u0435\u043D\u044B\u0445 \u0443\u0432\u043B\u0435\u043A\u043B\u0430\u0441\u044C \u0433\u0435\u043D\u0435\u0442\u0438\u043A\u043E\u0439. \u041F\u0435\u0440\u0435\u0448\u043B\u0430 \u0432\u00A0\u0418\u043D\u0441\u0442\u0438\u0442\u0443\u0442 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u0439 \u0440\u0430\u0434\u0438\u043E\u043B\u043E\u0433\u0438\u0438, \u043E\u0442\u0434\u0435\u043B \u0431\u0438\u043E\u0444\u0438\u0437\u0438