      i0.ɵɵelement(154, "iframe", 61);
      i0.ɵɵelementStart(155, "p", 49);
      i0.ɵɵtext(156, "\u0420\u0430\u0441\u0441\u043A\u0430\u0437\u044B \u043D\u0430\u0448\u0438\u0445 \u0433\u0435\u0440\u043E\u0438\u043D\u044C \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443\u044E\u0442 \u043E\u00A0\u0442\u043E\u043C, \u0447\u0442\u043E \u0435\u0441\u0442\u044C \u043E\u0431\u0449\u0438\u0435 \u0434\u043B\u044F \u043C\u0443\u0436\u0447\u0438\u043D \u0438\u00A0\u0434\u043B\u044F \u0436\u0435\u043D\u0449\u0438\u043D \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0432\u00A0\u043E\u0441\u043D\u043E\u0432\u043D\u043E\u043C \u0441\u0432\u044F\u0437\u0430\u043D\u044B \u0441\u00A0\u043F\u043E\u043F\u0430\u0434\u0430\u043D\u0438\u0435\u043C \u0432\u00A0\u0441\u0442\u0430\u0433\u043D\u0438\u0440\u0443\u044E\u0449\u0438\u0435 \u0441\u0444\u0435\u0440\u044B \u043D\u0430\u0443\u043A\u0438, \u0433\u0434\u0435 \u043C\u0430\u043B\u043E \u0438\u043D\u0442\u0435\u0440\u0435\u0441\u043D\u044B\u0445 \u043F\u0440\u043E\u0435\u043A\u0442\u043E\u0432 \u0438\u00A0\u043D\u0435\u0442 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F; \u0441\u00A0\u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u043E\u0441\u0442\u044C\u044E \u043F\u0435\u0440\u0435\u043A\u0432\u0430\u043B\u0438\u0444\u0438\u043A\u0430\u0446\u0438\u0438 \u043F\u0440\u0438 \u0441\u043C\u0435\u043D\u0435 \u043D\u0430\u0443\u0447\u043D\u043E\u0433\u043E \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u0438\u043B\u0438 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0438, \u0430\u00A0\u043E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u0443\u0447\u0438\u0442\u044C\u0441\u044F \u0438\u00A0\u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u043D\u0435\u043F\u0440\u043E\u0441\u0442\u043E; \u0441\u00A0\u043D\u0435\u0431\u043E\u043B\u044C\u0448\u043E\u0439 \u0437\u0430\u0440\u043F\u043B\u0430\u0442\u043E\u0439 \u043D\u0430\u0447\u0438\u043D\u0430\u044E\u0449\u0438\u0445 \u0443\u0447\u0435\u043D\u044B\u0445. \u0410\u00A0\u0435\u0449\u0435 \u0435\u0441\u0442\u044C \u0434\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u043A\u043E\u043C\u0430\u043D\u0434\u0438\u0440\u043E\u0432\u043A\u0438, \u043D\u043E\u0447\u043D\u044B\u0435 \u0441\u043C\u0435\u043D\u044B \u043D\u0430\u00A0\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430\u0445 \u0438\u00A0\u0441\u043E\u0437\u0432\u043E\u043D\u044B \u043F\u043E\u0437\u0434\u043D\u043E \u0432\u0435\u0447\u0435\u0440\u043E\u043C \u0441\u00A0\u043A\u043E\u043B\u043B\u0435\u0433\u0430\u043C\u0438 \u0438\u0437\u00A0\u043A\u043E\u043B\u043B\u0430\u0431\u043E\u0440\u0430\u0446\u0438\u0439 \u0432\u00A0\u0434\u0440\u0443\u0433\u0438\u0445 \u0447\u0430\u0441\u043E\u0432\u044B\u0445 \u043F\u043E\u044F\u0441\u0430\u0445.");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(157, "p", 49);
      i0.ɵɵtext(158, "\u0415\u0441\u0442\u044C \u0442\u0430\u043A\u0436\u0435 \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u044B, \u0441\u00A0\u043A\u043E\u0442\u043E\u0440\u044B\u043C\u0438 \u0441\u0442\u0430\u043B\u043A\u0438\u0432\u0430\u044E\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u0436\u0435\u043D\u0449\u0438\u043D\u044B. \u041E\u041E\u041D \u0441\u0447\u0438\u0442\u0430\u0435\u0442, \u0447\u0442\u043E \u00AB\u0433\u043B\u0430\u0432\u043D\u044B\u043C\u0438 \u043F\u0440\u0435\u043F\u044F\u0442\u0441\u0442\u0432\u0438\u044F\u043C\u0438 \u0434\u043B\u044F \u0436\u0435\u043D\u0449\u0438\u043D \u0432\u00A0\u043D\u0430\u0443\u043A\u0435 \u044F\u0432\u043B\u044F\u044E\u0442\u0441\u044F \u0441\u0442\u0435\u0440\u0435\u043E\u0442\u0438\u043F\u044B \u0438\u00A0\u043F\u0440\u0435\u0434\u0443\u0431\u0435\u0436\u0434\u0435\u043D\u0438\u044F \u0432\u00A0\u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u00BB. \u00AB\u0417\u0430\u0447\u0435\u043C \u0442\u0435\u0431\u0435 \u044D\u0442\u0430 \u043D\u0430\u0443\u043A\u0430?\u00BB, \u00AB\u0412\u044B\u00A0\u043C\u043D\u043E\u0433\u043E \u0432\u0438\u0434\u0435\u043B\u0438 \u0436\u0435\u043D\u0449\u0438\u043D-\u0430\u043A\u0430\u0434\u0435\u043C\u0438\u043A\u043E\u0432?\u00BB, \u00AB\u0423\u0439\u0434\u0435\u0448\u044C \u0441\u043D\u0430\u0447\u0430\u043B\u0430 \u0432\u00A0\u0434\u0435\u043A\u0440\u0435\u0442, \u0430\u00A0\u043F\u043E\u0442\u043E\u043C \u0438\u00A0\u0438\u0437\u00A0\u043D\u0430\u0443\u043A\u0438\u00BB\u00A0\u2014 \u0442\u0430\u043A\u0438\u0435 \u0444\u0440\u0430\u0437\u044B \u043C\u043E\u0436\u0435\u0442 \u0443\u0441\u043B\u044B\u0448\u0430\u0442\u044C \u043B\u044E\u0431\u0430\u044F \u0434\u0435\u0432\u0443\u0448\u043A\u0430, \u0440\u0435\u0448\u0438\u0432\u0448\u0430\u044F \u0441\u0432\u044F\u0437\u0430\u0442\u044C \u0441\u0432\u043E\u044E \u0436\u0438\u0437\u043D\u044C \u0441\u00A0\u043D\u0430\u0443\u043A\u043E\u0439, \u0438\u00A0\u043E\u0442\u00A0\u0440\u043E\u0434\u0438\u0442\u0435\u043B\u0435\u0439, \u0438\u00A0\u043E\u0442\u00A0\u0437\u043D\u0430\u043A\u043E\u043C\u044B\u0445, \u0438\u00A0\u043E\u0442\u00A0\u043A\u043E\u043B\u043B\u0435\u0433. \u041A\u0441\u0442\u0430\u0442\u0438, \u0434\u0435\u0432\u0443\u0448\u0435\u043A \u043D\u0435\u00A0\u043C\u043E\u0442\u0438\u0432\u0438\u0440\u0443\u0435\u0442 \u0438\u0434\u0442\u0438 \u0432\u00A0\u043D\u0430\u0443\u043A\u0443 \u0438\u00A0\u043C\u0430\u043B\u043E\u0435 \u043A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u043E \u0436\u0435\u043D\u0449\u0438\u043D \u0441\u0440\u0435\u0434\u0438 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0438\u0442\u0435\u043B\u0435\u0439, \u043E\u0431\u043B\u0430\u0434\u0430\u0442\u0435\u043B\u0435\u0439 \u0432\u044B\u0441\u043E\u043A\u0438\u0445 \u043D\u0430\u0443\u0447\u043D\u044B\u0445 \u0437\u0432\u0430\u043D\u0438\u0439 \u0438\u00A0\u043B\u0430\u0443\u0440\u0435\u0430\u0442\u043E\u0432 \u043F\u0440\u0435\u043C\u0438\u0439. \u0415\u0441\u043B\u0438\u00A0\u0431\u044B \u0436\u0435\u043D\u0449\u0438\u043D\u044B, \u0437\u0430\u043D\u0438\u043C\u0430\u044E\u0449\u0438\u0435 \u0442\u0430\u043A\u0438\u0435 \u0434\u043E\u043B\u0436\u043D\u043E\u0441\u0442\u0438 \u0438\u00A0\u043E\u0431\u043B\u0430\u0434\u0430\u044E\u0449\u0438\u0435 \u0442\u0430\u043A\u0438\u043C\u0438 \u0437\u0432\u0430\u043D\u0438\u044F\u043C\u0438, \u0431\u044B\u043B\u0438\u00A0\u0431\u044B \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u044B \u0432\u00A0\u043D\u0430\u0443\u043A\u0435 \u0432\u00A0\u0440\u0430\u0432\u043D\u043E\u0439 \u0441\u0442\u0435\u043F\u0435\u043D\u0438 \u0441\u00A0\u043C\u0443\u0436\u0447\u0438\u043D\u0430\u043C\u0438, \u044D\u0442\u043E \u043C\u043E\u0433\u043B\u043E\u00A0\u0431\u044B \u0441\u043B\u0443\u0436\u0438\u0442\u044C \u043F\u0440\u0438\u043C\u0435\u0440\u043E\u043C \u0443\u0441\u043F\u0435\u0448\u043D\u043E\u0439 \u0441\u0430\u043C\u043E\u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0436\u0435\u043D\u0449\u0438\u043D \u0438\u00A0\u043F\u0440\u0438\u0432\u043B\u0435\u043A\u0430\u0442\u044C \u0432\u00A0\u043D\u0430\u0443\u043A\u0443 \u0431\u043E\u043B\u044C\u0448\u0435 \u0434\u0435\u0432\u0443\u0448\u0435\u043A.");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(159, "p", 49);
      i0.ɵɵtext(160, "\u0415\u0441\u0442\u044C \u0443\u00A0\u0436\u0435\u043D\u0449\u0438\u043D\u044B \u0438\u00A0\u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0435 \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u0438. \u0423\u0445\u043E\u0434 \u0432\u00A0\u0434\u0435\u043A\u0440\u0435\u0442 \u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u043E\u0442\u0441\u0442\u0430\u0432\u0430\u043D\u0438\u0435 \u0432\u00A0\u043D\u0430\u0443\u043A\u0435. \u0418\u00A0\u0435\u0441\u043B\u0438 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u043E \u0438\u00A0\u043A\u043E\u043B\u043B\u0435\u0433\u0438 \u043D\u0435\u00A0\u043F\u043E\u043C\u043E\u0433\u0443\u0442, \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0435\u043D\u0438\u0435 \u043C\u043E\u0436\u0435\u0442 \u0431\u044B\u0442\u044C \u0441\u043B\u043E\u0436\u043D\u044B\u043C. \u0418\u00A0\u0441\u043E\u0447\u0435\u0442\u0430\u0442\u044C \u0441\u0435\u043C\u044C\u044E \u0438\u00A0\u043A\u0430\u0440\u044C\u0435\u0440\u0443 \u0442\u043E\u0436\u0435 \u0441\u043E\u0432\u0441\u0435\u043C \u043D\u0435\u00A0\u043F\u0440\u043E\u0441\u0442\u043E: \u0431\u0435\u0437 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0441\u0435\u043C\u044C\u0438 \u043D\u0435\u00A0\u043E\u0431\u043E\u0439\u0442\u0438\u0441\u044C.");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(161, "p", 49);
      i0.ɵɵtext(162, "\u0412\u00A0\u043A\u043E\u043D\u0446\u0435 \u043F\u0440\u043E\u0448\u043B\u043E\u0433\u043E \u0432\u0435\u043A\u0430, \u043A\u043E\u0433\u0434\u0430 \u043D\u0435\u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0438\u0437\u00A0\u043D\u0430\u0448\u0438\u0445 \u0433\u0435\u0440\u043E\u0438\u043D\u044C \u0442\u043E\u043B\u044C\u043A\u043E \u043D\u0430\u0447\u0438\u043D\u0430\u043B\u0438 \u0441\u0432\u043E\u0439 \u043F\u0443\u0442\u044C \u0432\u00A0\u043D\u0430\u0443\u043A\u0435, \u043F\u0440\u043E\u0431\u043B\u0435\u043C \u0431\u044B\u043B\u043E \u043D\u0435\u00A0\u043C\u0435\u043D\u044C\u0448\u0435. \u041E\u0434\u043D\u0430\u0436\u0434\u044B \u0418.\u00A0\u0412. \u0422\u0438\u0442\u043A\u043E\u0432\u0430 \u043E\u0431\u043D\u0430\u0440\u0443\u0436\u0438\u043B\u0430, \u0447\u0442\u043E \u0435\u0435\u00A0\u0432\u044B\u043F\u043B\u0430\u0442\u044B \u043F\u043E\u00A0\u0433\u0440\u0430\u043D\u0442\u0443 \u043D\u0430\u00A0\u043F\u0440\u043E\u0435\u043A\u0442 \u0432\u00A0\u0447\u0435\u0442\u044B\u0440\u0435 \u0440\u0430\u0437\u0430 \u043C\u0435\u043D\u044C\u0448\u0435, \u0447\u0435\u043C \u0443\u00A0\u0435\u0435\u00A0\u043A\u043E\u043B\u043B\u0435\u0433: \u00AB\u042F\u00A0\u0440\u0430\u0431\u043E\u0442\u0430\u043B\u0430 \u0432\u00A0\u043A\u043E\u043C\u0430\u043D\u0434\u0435, \u043A\u0430\u043A \u0432\u0441\u0435, \u0430\u00A0\u043F\u043E\u043B\u0443\u0447\u0430\u043B\u0430 \u043C\u0435\u043D\u044C\u0448\u0435\u00BB. \u0418\u0441\u043F\u0440\u0430\u0432\u0438\u0442\u044C \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u044E \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u043E \u043E\u0442\u043A\u0430\u0437\u0430\u043B\u043E\u0441\u044C. \u00AB\u041A\u00A0\u043C\u0443\u0436\u0447\u0438\u043D\u0435\u00A0\u0431\u044B \u0442\u0430\u043A \u043D\u0435\u00A0\u043E\u0442\u043D\u043E\u0441\u0438\u043B\u0438\u0441\u044C\u00BB,\u00A0\u2014 \u0443\u0432\u0435\u0440\u0435\u043D\u0430 \u0418\u0440\u0438\u043D\u0430 \u0412\u0438\u043A\u0442\u043E\u0440\u043E\u0432\u