      i0.ɵɵtext(169, " \u0413.\u00A0\u0410.\u00A0\u041A\u0430\u0440\u0430\u043C\u044B\u0448\u0435\u0432\u043E\u0439 \u043F\u0440\u0438\u0448\u043B\u043E\u0441\u044C \u0438\u0434\u0442\u0438 \u043D\u0430\u00A0\u043F\u0440\u0438\u0435\u043C \u043A\u00A0\u0434\u0435\u043F\u0443\u0442\u0430\u0442\u0443, \u0447\u0442\u043E\u0431\u044B \u0434\u043E\u0431\u0438\u0442\u044C\u0441\u044F \u0432\u0430\u043A\u0430\u043D\u0441\u0438\u0438, \u043F\u043E\u043B\u043E\u0436\u0435\u043D\u043D\u043E\u0439 \u043F\u043E\u00A0\u0437\u0430\u043A\u043E\u043D\u0443 \u043E\u00A0\u043C\u043E\u043B\u043E\u0434\u044B\u0445 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u0438\u0441\u0442\u0430\u0445. \u00AB\u041D\u0443\u0436\u043D\u044B \u0437\u0430\u043A\u043E\u043D\u044B, \u0438\u00A0\u0442\u043E\u0433\u0434\u0430 \u043D\u0435\u00A0\u0431\u0443\u0434\u0435\u0442 \u043D\u0438\u043A\u0430\u043A\u043E\u0439 \u0434\u0438\u0441\u043A\u0440\u0438\u043C\u0438\u043D\u0430\u0446\u0438\u0438\u00BB,\u00A0\u2014 \u0441\u0447\u0438\u0442\u0430\u0435\u0442 \u0413\u0430\u043B\u0438\u043D\u0430 \u0410\u043D\u0430\u0442\u043E\u043B\u044C\u0435\u0432\u043D\u0430. \u0412\u0430\u0436\u043D\u043E \u0442\u0430\u043A\u0436\u0435 \u043F\u043E\u043C\u043E\u0433\u0430\u0442\u044C \u0436\u0435\u043D\u0449\u0438\u043D\u0435, \u00AB\u0441\u043E\u0437\u0434\u0430\u0432\u0430\u0442\u044C \u0443\u0441\u043B\u043E\u0432\u0438\u044F \u0434\u043B\u044F \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0435\u043D\u0438\u044F \u0438\u0437\u00A0\u0434\u0435\u043A\u0440\u0435\u0442\u043D\u043E\u0433\u043E \u043E\u0442\u043F\u0443\u0441\u043A\u0430\u00BB, \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0442\u044C\u00A0\u0435\u0435, \u043F\u043E\u043A\u0430 \u043E\u043D\u0430 \u0432\u043E\u0441\u043F\u0438\u0442\u044B\u0432\u0430\u0435\u0442 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0438\u0445 \u0434\u0435\u0442\u0435\u0439. \u00AB\u0414\u043E\u043B\u0436\u043D\u043E \u0431\u044B\u0442\u044C \u0438\u00A0\u043A\u0430\u043A\u043E\u0435-\u0442\u043E \u0441\u043D\u0438\u0441\u0445\u043E\u0436\u0434\u0435\u043D\u0438\u0435, \u0438\u00A0\u0443\u0441\u043B\u043E\u0432\u0438\u044F\u00BB,\u00A0\u2014 \u0443\u0432\u0435\u0440\u0435\u043D\u0430 \u0413.\u00A0\u0410.\u00A0\u041A\u0430\u0440\u0430\u043C\u044B\u0448\u0435\u0432\u0430. \u0412\u00A0\u043F\u0440\u0438\u043C\u0435\u0440 \u043E\u043D\u0430 \u043F\u0440\u0438\u0432\u043E\u0434\u0438\u0442 \u043E\u043F\u044B\u0442 \u0441\u0432\u043E\u0438\u0445 \u0437\u0430\u0440\u0443\u0431\u0435\u0436\u043D\u044B\u0445 \u043A\u043E\u043B\u043B\u0435\u0433..");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(170, "p", 49);
      i0.ɵɵtext(171, "\u0412\u00A0\u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0435 \u0443\u00A0\u043D\u0430\u0448\u0438\u0445 \u0441\u043E\u0431\u0435\u0441\u0435\u0434\u043D\u0438\u0446 \u0432\u0441\u0435 \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u043E\u0441\u044C: \u0441\u043B\u043E\u0436\u0438\u043B\u0430\u0441\u044C \u043A\u0430\u0440\u044C\u0435\u0440\u0430, \u0441\u043E\u0441\u0442\u043E\u044F\u043B\u0438\u0441\u044C \u0441\u0435\u0440\u044C\u0435\u0437\u043D\u044B\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u044B, \u0434\u043E\u0441\u0442\u0438\u0433\u043D\u0443\u0442\u044B \u0432\u0430\u0436\u043D\u044B\u0435 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u044B. \u0423\u043F\u043E\u0440\u0441\u0442\u0432\u043E, \u043B\u044E\u0431\u043E\u0432\u044C \u043A\u00A0\u043D\u0430\u0443\u043A\u0435, \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0430 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u0430, \u043F\u043E\u043C\u043E\u0449\u044C \u0441\u0435\u043C\u044C\u0438\u00A0\u2014 \u0432\u043E\u0442 \u0447\u0442\u043E \u043F\u043E\u043C\u043E\u0433\u043B\u043E \u043D\u0430\u0448\u0438\u043C \u0433\u0435\u0440\u043E\u0438\u043D\u044F\u043C.");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(172, "p", 49);
      i0.ɵɵtext(173, "\u041E\u043D\u0438 \u043E\u0442\u043C\u0435\u0447\u0430\u044E\u0442, \u0447\u0442\u043E \u0432\u00A0\u041E\u0431\u044A\u0435\u0434\u0438\u043D\u0435\u043D\u043D\u043E\u043C \u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0442\u0435 \u044F\u0434\u0435\u0440\u043D\u044B\u0445 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u0439 \u0441\u0435\u0439\u0447\u0430\u0441 \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u043A\u043E\u043C\u0444\u043E\u0440\u0442\u043D\u043E. \u041B\u044E\u0434\u043C\u0438\u043B\u0430 \u041A\u043E\u043B\u0443\u043F\u0430\u0435\u0432\u0430 \u0433\u043E\u0432\u043E\u0440\u0438\u0442 \u043E\u0431\u00A0\u044D\u0442\u043E\u043C \u0442\u0430\u043A: \u00AB\u041E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F \u043C\u0435\u0436\u0434\u0443 \u043A\u043E\u043B\u043B\u0435\u0433\u0430\u043C\u0438 \u0432\u00A0\u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u0445 \u043A\u043E\u043B\u043B\u0430\u0431\u043E\u0440\u0430\u0446\u0438\u044F\u0445, \u0432\u00A0\u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0443\u0447\u0430\u0441\u0442\u0432\u0443\u044E\u0442 \u043D\u0430\u0448\u0438 \u0441\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u043A\u0438, \u0438\u00A0\u0434\u0435\u043C\u043E\u043A\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u0438 \u0441\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0432\u00A0\u043F\u043E\u0434\u0440\u0430\u0437\u0434\u0435\u043B\u0435\u043D\u0438\u044F\u0445 \u0418\u043D\u0441\u0442\u0438\u0442\u0443\u0442\u0430 \u0441\u043B\u0443\u0436\u0430\u0442 \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u0435\u043C \u0434\u043B\u044F \u043E\u043F\u0442\u0438\u043C\u0438\u0437\u043C\u0430\u00BB.");
      i0.ɵɵelementEnd();
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(174, "section", 65);
      i0.ɵɵelementStart(175, "div", 66);
      i0.ɵɵelementStart(176, "h2", 43);
      i0.ɵɵtext(177, "\u041F\u043E\u0436\u0435\u043B\u0430\u043D\u0438\u044F");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(178, "div", 44);
      i0.ɵɵelementStart(179, "p", 45);
      i0.ɵɵtext(180, "\u00AB\u0418\u0434\u0442\u0438 \u0437\u0430 \u0441\u0432\u043E\u0435\u0439 \u043C\u0435\u0447\u0442\u043E\u0439!\u00BB");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(181, "p", 46);
      i0.ɵɵtext(182, "\u041A\u043E\u0433\u0434\u0430 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u0435\u0448\u044C\u0441\u044F \u0441 \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u044F\u043C\u0438, \u043D\u0435 \u0437\u043D\u0430\u0435\u0448\u044C, \u043A\u0430\u043A \u0440\u0435\u0448\u0438\u0442\u044C\u0441\u044F \u043D\u0430 \u0432\u0430\u0436\u043D\u044B\u0439 \u0448\u0430\u0433 \u0438\u043B\u0438 \u0440\u0430\u0437\u0440\u0435\u0448\u0438\u0442\u044C \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u0443, \u043C\u043E\u0436\u0435\u0442 \u043F\u043E\u043C\u043E\u0447\u044C \u043F\u0440\u0438\u043C\u0435\u0440 \u0438\u043B\u0438 \u0441\u043E\u0432\u0435\u0442 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0432\u0430\u0441 \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u0435\u0442. ");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(183, "p", 46);
      i0.ɵɵtext(184, "\u0415\u0441\u0442\u044C \u0442\u0430\u043A\u0438\u0435 \u043F\u0440\u0438\u043C\u0435\u0440\u044B \u0438 \u0443 \u043D\u0430\u0448\u0438\u0445 \u0433\u0435\u0440\u043E\u0438\u043D\u044C. \u0410 \u0441\u0430\u043C\u0438 \u043E\u043D\u0438 \u0434\u0430\u044E\u0442 \u0441\u043E\u0432\u0435\u0442\u044B \u0431\u0443\u0434\u0443\u0449\u0438\u043C \u0438 \u043D\u0430\u0447\u0438\u043D\u0430\u044E\u0449\u0438\u043C \u0443\u0447\u0435\u043D\u044B\u043C, \u043A\u0430\u043A \u043D\u0435 \u0440\u0430\u0437\u043E\u0447\u0430\u0440\u043E\u0432\u0430\u0442\u044C\u0441\u044F \u0432 \u043D\u0430\u0443\u043A\u0435, \u043A\u0430\u043A \u0431\u044B\u0442\u044C \u0440\u0435\u0448\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u043C \u0438 \u0438\u0434\u0442\u0438 \u0437\u0430 \u0441\u0432\u043E\u0435\u0439 \u043C\u0435\u0447\u0442\u043E\u0439. ");
      i0.ɵɵelementEnd();
      i0.ɵɵelementEnd();
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(185, "p", 49);
      i0.ɵɵtext(186, "\u0418\u0440\u0438\u043D\u0443 \u0422\u0438\u0442\u043A\u043E\u0432\u0443 \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u0435\u0442 \u0436\u0438\u0437\u043D\u044C \u0421\u043E\u0444\u044C\u0438 \u041A\u043E\u0432\u0430\u043B\u0435\u0432\u0441\u043A\u043E\u0439, \u0434\u0435\u0432\u0438\u0437 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 - \u201C\u0413\u043E\u0432\u043E\u0440\u0438, \u0447\u0442\u043E \u0437\u043D\u0430\u0435\u0448\u044C, \u0434\u0435\u043B\u0430\u0439, \u0447\u0442\u043E \u043E\u0431\u044F\u0437\u0430\u043D, \u0438 \u0431\u0443\u0434\u044C, \u0447\u0442\u043E \u0431\u0443\u0434\u0435\u0442\u201D. \u0418\u0440\u0438\u043D\u0430 \u0412\u0438\u043A\u0442\u043E\u0440\u043E\u0432\u043D\u0430 \u0434\u043E\u0431\u0430\u0432\u043B\u044F\u0435\u0442: \u201C\u0421\u0435\u0439\u0447\u0430\u0441 \u044F \u0441\u0447\u0438\u0442\u0430\u044E, \u0447\u0442\u043E \u201C\u0431\u0443\u0434\u044C, \u0447\u0442\u043E \u0431\u0443\u0434\u0435\u0442\u201D \u043D\u0435\u043C\u043D\u043E\u0436\u043A\u043E \u043D\u0435 \u043C\u043E\u0451: \u043C\u044B \u0441\u0430\u043C\u0438 \u0434\u0435\u043B\u0430\u0435\u043C \u0441\u0432\u043E\u0451 \u0431\u0443\u0434\u0443\u0449\u0435\u0435\u201D. \u041B\u044E\u0434\u043C\u0438\u043B\u0443 \u041A\u043E\u043B\u0443\u043F\u0430\u0435\u0432\u0443 \u0432\u043E\u0441\u0445\u0438\u0449\u0430\u044E\u0442 \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u0438: \u041C\u0430\u0440\u0438\u044F \u041A\u044E\u0440\u0438-\u0421\u043A\u043B\u043E\u0434\u043E\u0432\u0441\u043A\u0430\u044F, \u042D\u043C\u043C\u0438 \u041D\u0451\u0442\u0435\u0440, \u0418\u0440\u044D\u043D \u0416\u043E\u043B\u0438\u043E-\u041A\u044E\u0440\u0438, - \u0430 \u0442\u0430\u043A\u0436\u0435 \u0436\u0435\u043D\u0449\u0438\u043D\u044B, \u0435\u0435 \u043A\u043E\u043B\u043B\u0435\u0433\u0438 \u043F\u043E \u043A\u043E\u043B\u043B\u0430\u0431\u043E\u0440\u0430\u0446\u0438\u044F\u043C, \u201C\u043D\u0430 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u044F \u0441\u043C\u043E\u0442\u0440\u044E \u043A\u0430\u0436\u0434\u044B\u0439 \u0434\u0435\u043D\u044C \u0438 \u0432\u0438\u0436\u0443, \u043A\u0430\u043A \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u0438\u0445 \u0436\u0438\u0437\u043D\u044C\u201D. \u041A\u043E\u043B\u043B\u0435\u0433\u0438 \u043F\u043E \u043F\u0440\u043E\u0435\u043A\u0442\u0430\u043C, \u0430 \u0442\u0430\u043A\u0436\u0435 \u0443\u0447\u0438\u0442\u0435\u043B\u044F \u0438 \u043D\u0430\u0441\u0442\u0430\u0432\u043D\u0438\u043A\u0438 \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u044E\u0442 \u0438 \u0414\u0430\u043D\u0438\u044E \u0417\u0438\u043D\u0430\u0442\u0443\u043B\u0438\u043D\u0443. ");
      i0.ɵɵelementEnd();
